create table USER_PROFILES (
	up_user_id INT,
	up_dp VARCHAR(50),
	up_name VARCHAR(50),
	up_user_name VARCHAR(50),
	up_gender VARCHAR(50),
	up_date_joined DATE,
	up_preferred_categories VARCHAR(50),
	up_preferred_gender VARCHAR(50),
	up_contact_number VARCHAR(50),
	up_email VARCHAR(50),
	up_password VARCHAR(50),

	PRIMARY KEY(up_user_id),
	FOREIGN KEY (up_user_id) REFERENCES USERS(user_id)
);
